import React, { Component } from 'react';
import { Link, Redirect } from 'react-router-dom';
import { Table } from 'react-bootstrap';

class Busca_Voo_Matricula extends Component {
    constructor(props){
        super(props);
    }
    render() {
        const dados = this.props.dados_voo_aluno
        return (
            <Table dark>
                <thead>
                    <tr>
                        <th>ID Voo</th>
                        <th>Número Matrícula Aluno</th>
                        <th>Número Cadastro Instrutor</th>
                        <th>Data</th>
                        <th>Hora</th>
                        <th>Duração</th>
                        <th>Nota</th>
                    </tr>
                </thead>
            </Table>
        )
      }
}
export default Busca_Voo_Matricula;
